import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { PieChart, Pie, Cell, ResponsiveContainer, ScatterChart, Scatter, XAxis, YAxis, CartesianGrid, Tooltip } from 'recharts';

const Analytics = () => {
  const [riskData, setRiskData] = useState([]);
  const [cohortData, setCohortData] = useState([]);

  useEffect(() => {
    // Fetch risk analysis
    axios.get('http://localhost:8000/api/analytics/risk-analysis')
      .then(response => setRiskData(response.data))
      .catch(error => console.error('Error fetching risk data:', error));
    
    // Fetch cohort comparison
    axios.get('http://localhost:8000/api/analytics/cohort-comparison')
      .then(response => setCohortData(response.data.comparison))
      .catch(error => console.error('Error fetching cohort data:', error));
  }, []);

  const pieData = [
    { name: 'Low Risk', value: 70, color: '#00C49F' },
    { name: 'Medium Risk', value: 20, color: '#FFBB28' },
    { name: 'High Risk', value: 10, color: '#FF8042' },
  ];

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold mb-6">Analytics Dashboard</h1>
      
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4">Risk Distribution</h2>
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie
                data={pieData}
                cx="50%"
                cy="50%"
                labelLine={false}
                label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
                outerRadius={80}
                fill="#8884d8"
                dataKey="value"
              >
                {pieData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={entry.color} />
                ))}
              </Pie>
              <Tooltip />
            </PieChart>
          </ResponsiveContainer>
        </div>

        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4">GPA vs Study Hours</h2>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart data={cohortData}>
              <CartesianGrid />
              <XAxis type="number" dataKey="study_hours" name="Study Hours" />
              <YAxis type="number" dataKey="gpa" name="GPA" />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} />
              <Scatter name="Students" data={cohortData} fill="#8884d8" />
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-md mt-6">
        <h2 className="text-xl font-semibold mb-4">At-Risk Students</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full table-auto">
            <thead>
              <tr className="bg-gray-50">
                <th className="px-4 py-2 text-left">Student ID</th>
                <th className="px-4 py-2 text-left">Name</th>
                <th className="px-4 py-2 text-left">Risk Score</th>
                <th className="px-4 py-2 text-left">Predicted Performance</th>
                <th className="px-4 py-2 text-left">Actions</th>
              </tr>
            </thead>
            <tbody>
              {riskData.map(student => (
                <tr key={student.id} className="border-t">
                  <td className="px-4 py-2">{student.id}</td>
                  <td className="px-4 py-2">{student.name}</td>
                  <td className="px-4 py-2">
                    <span className={`px-2 py-1 rounded ${
                      student.risk_score > 0.7 ? 'bg-red-100 text-red-800' :
                      student.risk_score > 0.4 ? 'bg-yellow-100 text-yellow-800' :
                      'bg-green-100 text-green-800'
                    }`}>
                      {student.risk_score.toFixed(2)}
                    </span>
                  </td>
                  <td className="px-4 py-2">{student.predicted_performance}</td>
                  <td className="px-4 py-2">
                    <button className="bg-blue-500 text-white px-3 py-1 rounded hover:bg-blue-600">
                      View Details
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Analytics;
